const MainPage = () => {
  return (
    <div className="ui center aligned two column grid">
      <div className="twelve wide column">POSTS</div>
      <div className="four wide column">
        <h5 className="header">Popular:</h5>
        POPULAR
      </div>
    </div>
  );
};

export default MainPage;
